@use "macro-css/index" as *;
@use "./config" as *;
@use "./pulse" as *;

.alert {
  position: relative;
  padding: 1rem 1rem;
  margin-bottom: 1rem;
  border: 1px solid transparent;
  border-radius: 0.25rem;
}

.alert-success {
  color: #0f5132;
  background-color: #d1e7dd;
  border-color: #badbcc;
}

.alert-success {
  color: #0c4128;
}

.alert-message {
  position: fixed;
  top: -5%;
  left: 50%;
  text-align: center;
  -webkit-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
  opacity: 0;
  -webkit-animation: showOut 2.5s ease-out;
  animation: showOut 2.5s ease-out;
  z-index: 1003;
}

.thunder-holder {
  position: relative;
}

.thunder {
  position: absolute;
  top: -54%;
  left: 38%;
  width: 200px;
  z-index: -100;
}

@-webkit-keyframes showOut {  
  30%,
  100% {
    opacity: 1;
  }
  30% {
    -webkit-transform: translate(-50%, 115%);
    transform: translate(-50%, 115%);
  }
  100% {
    -webkit-transform: translate(-50%, 115%);
    transform: translate(-50%, 115%);
  }
}

@keyframes showOut {
  30%,
  100% {
    opacity: 1;
  }
  30% {
    -webkit-transform: translate(-50%, 115%);
    transform: translate(-50%, 115%);
  }
  100% {
    -webkit-transform: translate(-50%, 115%);
    transform: translate(-50%, 115%);
  }
}

.bg-purple {
  background: linear-gradient(180deg, #7a00a5 0%, #bd00ff 99.09%);
}

.wrapper {
  width: 100%;
}

.header,
.banner {
  max-width: 1440px;
  width: 100%;
}

.bg-images {
  max-width: 1400px;
  width: 100%;
  height: 550px;
  position: absolute;
  left: 50%;
  transform: translate(-50%);
  z-index: -1000;
  .bg-img {
    position: absolute;
    z-index: -1000;
    &1 {
      top: -8%;
      left: 91%;
      width: 65px;
    }
    &2 {
      top: 30%;
      left: 88%;
      width: 50px;
    }
    &3 {
      top: 67%;
      left: 70%;
      width: 28px;
    }
    &4 {
      top: 69%;
      left: 54%;
      width: 128px;
    }
    &5 {
      top: 87%;
      left: 48%;
      width: 18px;
    }
    &6 {
      top: 77%;
      left: 1%;
      width: 150px;
    }
    &7 {
      top: -5%;
      left: 3%;
      width: 31px;
    }
  }
}

.header {
  width: 100%;
  padding: 0 120px;

  margin-bottom: 30px;

  &__logo {
    font-size: 30px;
    b {
      font-size: 30px;
    }

    img {
      width: 60px;
      height: 60px;
    }
  }

  .img-c {
    position: relative;
    top: -20px;
  }

  .header__right img {
    width: 30px;
    height: 30px;
  }
}

.switch-form .button-start.mobile {
  display: none;
}

a.button-start,
button.form-button {
  -webkit-touch-callout: none; /* iOS Safari */
  -webkit-user-select: none; /* Safari */
  -khtml-user-select: none; /* Konqueror HTML */
  -moz-user-select: none; /* Old versions of Firefox */
  -ms-user-select: none; /* Internet Explorer/Edge */
  user-select: none;
}

.button-start {
  display: inline-block;
  max-width: 270px;
  width: 100%;
  height: 77px;
  border: none;
  border-radius: 100px;
  font-weight: 600;
  font-size: 18px;
  line-height: 37px;

  &:hover {
    transform: scale(1.05, 1.05);
    transition: all 0.3s ease-in-out;
  }

  &:active {
    transform: scale(1, 1);
    opacity: 0.7;
    transition: all 0.4s ease-in-out;
  }
}

.banner {
  display: flex;
  padding: 0 120px;
  width: 100%;
  margin: 0 auto;

  margin-bottom: 100px;

  h1 {
    font-weight: 800;
    font-size: 35px;

    color: #000000;
    margin-bottom: 40px;
  }

  h2 {
    font-weight: 400;
    font-size: 25px;
    /* identical to box height */
    margin-bottom: 40px;

    b {
      font-size: 25px;
    }

    color: #000000;
  }
  div {
    flex: 1;
  }

  .banner-discount {
    width: 400px;
    text-align: center;
  }

  .banner-image {
    text-align: center;
    img {
      max-width: 375px;
      width: 100%;
    }
  }

  .banner-discount p {
    margin-bottom: 20px;
  }

  span.text-purple {
    font-weight: 700;
    text-align: center;

    color: #bf13fc;
  }

  .banner-timer {
    font-weight: 600;
    font-size: 35px;
    text-align: center;

    color: #000000;

    margin-bottom: 20px;
  }

  .button-start {
    background: linear-gradient(180deg, #bf13fc 0%, #6b0090 100%);
    border-radius: 100px;
    max-width: 400px;
    width: 100%;
    box-shadow: 0px 0px 30px #d661ff;

    line-height: 84px;
    height: 85px;

    font-weight: 700;
    font-size: 25px;
    text-align: center;

    color: #ffffff;
  }
}

.banner-under {
  img {
    width: 100%;
  }
  .banner-mobile {
    display: none;
  }

  margin-bottom: 100px;
}

.switch-form {
  padding-bottom: 100px;
  h3 {
    font-style: normal;
    font-weight: 900;
    font-size: 32px;
    text-align: center;

    color: #000000;
    margin-bottom: 23px;
  }

  .title-desc {
    max-width: 700px;
    width: 100%;
    margin: auto;

    font-size: 21px;
    text-align: center;

    color: #000000;
  }

  .img {
    text-align: center;

    background-image: url("../images/stars.svg");
    background-repeat: no-repeat;
    background-size: cover;
    background-size: 90% 90%;
    background-position: center;

    margin-bottom: 50px;

    .gift-mobile {
      display: none;
    }

    img {
      max-width: 540px;
      width: 100%;
    }
  }

  .button-start {
    background: linear-gradient(180deg, #d661ff 0%, #6d0094 100%);
    border-radius: 100px;
    max-width: 400px;
    width: 100%;

    font-weight: 700;
    text-align: center;

    color: #ffffff;

    margin-bottom: 100px;

    line-height: 96px;
    font-size: 25px;
    height: 100px;
  }
}

.course-people {
  padding: 0 130px;

  h3 {
    font-style: normal;
    font-weight: 900;
    font-size: 41px;
    max-width: 600px;
    margin: 0 auto;

    span {
      font-size: 41px;
    }

    margin-bottom: 100px;
    /* or 123% */

    text-align: center;

    color: #000000;
  }

  .button-start {
    background: linear-gradient(180deg, #bf13fc 0%, #6b0090 100%);
    box-shadow: 0px 0px 30px #d661ff;
    border-radius: 100px;

    max-width: 400px;
    width: 100%;
    font-weight: 700;
    text-align: center;

    color: #ffffff;

    margin-bottom: 200px;

    line-height: 75px;
    font-size: 25px;
  }
}

.people-holder {
  display: flex;
  justify-content: space-around;
  flex-wrap: wrap;
  align-items: center;
  gap: 80px;

  padding: 0 150px;

  margin-bottom: 200px;
  .people-item {
    width: 370px;

    // &:nth-child(even) {
    //   margin: 30px 120px 30px 50px;
    // }
    // &:nth-child(odd) {
    //   margin: 30px 50px 30px 120px;
    // }

    .img-holder {
      background: radial-gradient(
          139.8% 145.82% at -10.2% -6.6%,
          #d661ff 0%,
          #7a00a5 56.57%,
          #cc5cf3 100%
        )
        /* warning: gradient uses a rotation that is not supported by CSS and may not behave as expected */;
      box-shadow: inset 0px 12px 4px rgba(0, 0, 0, 0.25);

      width: 300px;
      margin: 0 auto;
      height: 300px;
      border-radius: 50%;
      overflow: hidden;

      img {
        width: 300px;
      }

      margin-bottom: 30px;
    }

    .item-title {
      font-weight: 900;
      font-size: 25px;
      text-align: center;

      color: #000000;

      margin-bottom: 10px;
    }

    .item-desc {
      text-align: center;
    }
  }
}

.diagonal-box {
  background: #000000;
  box-shadow: 0px 8px 15px rgba(0, 0, 0, 0.25);
  transform: rotate(-4deg) skew(-4deg) scaleX(1.008);

  font-style: italic;
  font-weight: 900;
  font-size: 40px;
  color: #faff00;
  text-align: center;

  padding: 35px;

  margin-bottom: 100px;
}

.info-course {
  .img {
    padding: 30px;
    img {
      max-width: 900px;
      width: 100%;
      margin: 0px;
    }

    margin-bottom: 100px;
  }

  .gift-mobile {
    display: none;
  }

  .button-start {
    border: 3px solid #cb0000;
    border-radius: 100px;

    background-color: transparent;

    max-width: 400px;
    width: 100%;

    font-weight: 700;
    font-size: 28px;
    text-align: center;

    color: #cb0000;

    margin-bottom: 200px;

    line-height: 68px;
  }
}

.result {
  padding: 70px 150px 130px;
  background: linear-gradient(89.61deg, #bf13fc -36.23%, #000000 112.62%);

  .h3-result,
  .h3-result > span {
    text-align: center;

    font-style: italic;
    font-weight: 900;
    font-size: 35px;

    color: #ffffff;

    margin-bottom: 50px;
  }

  .h3-result {
    .desktop-h {
      background-image: url("../images/desktop-h.svg");
      background-repeat: no-repeat;
      background-size: 100% 160%;
      padding-bottom: 20px;
      margin-bottom: 0;
    }
  }

  .grid-holder {
    width: 1300px;
    max-width: 100%;
    margin: 0 auto;
    display: flex;
    flex-wrap: wrap;
    justify-content: space-around;
    gap: 50px;
  }

  .grid-item {
    display: flex;
    align-items: center;

    max-width: 370px;
    width: 100%;

    height: 100px;
    span {
      margin-right: 20px;

      font-weight: 600;
      font-size: 45px;

      color: #d3caff;
    }

    p {
      flex: 1;
      font-size: 15px;
      color: #ffffff;

      b {
        font-size: 15px;
      }
    }

    padding: 20px;

    background: linear-gradient(180deg, #ae88dd 0%, #8750cb 100%);
    border-radius: 10px;
  }

  .button-start {
    margin-top: 70px;
    max-width: 340px;
    width: 100%;
    font-weight: 600;
    font-size: 25px;
    /* identical to box height */

    text-align: center;

    color: #ffffff;

    border: 3px solid #ffffff;
    border-radius: 100px;

    background: transparent;

    line-height: 68px;
  }
}

.program-course {
  width: 100%;
  padding: 0 100px;
  padding-top: 100px;
  padding-bottom: 150px;

  .program-title {
    font-weight: 900;
    font-size: 65px;
    text-align: center;
    font-family: sans-serif;

    color: #000;
    -webkit-text-fill-color: transparent;
    -webkit-text-stroke-width: 1px;

    margin-bottom: 100px;
  }

  .course-holder {
    max-width: 1300px;
    width: 100%;
    margin: 0 auto;

    display: flex;
    justify-content: space-around;
    margin-bottom: 150px;
  }

  .course-item {
    position: relative;
    display: flex;
    flex-direction: column;
    width: 390px;
    padding: 25px 7px 10px;
    background: radial-gradient(
        95.78% 107.98% at 4.17% 1.86%,
        #7a00a5 0%,
        #a46cff 100%
      )
      /* warning: gradient uses a rotation that is not supported by CSS and may not behave as expected */;
    box-shadow: 0px 0px 4px rgba(0, 0, 0, 0.25);
    border-radius: 20px;

    z-index: 0;
    & > * {
      z-index: 2;
    }
  }

  img.zakup-img {
    position: absolute;
    transform: translate(-50%, -80%);
    z-index: 1;

    top: 63%;
    left: 50%;
    width: 70%;
  }

  .sk-img {
    position: absolute;
    top: 57%;
    left: 50%;
    width: 70%;
    transform: translate(-50%, -65%);
    z-index: 1;
  }

  .course-title {
    color: #fff;
    margin-bottom: 5px;
    font-weight: 900;
    font-size: 20px;
    line-height: 30px;
    text-align: center;
  }

  .course-desc {
    color: #fff;
    text-align: center;
    margin-bottom: 30px;
    font-size: 15px;
  }

  .course-steps {
    text-align: center;
    font-weight: 500;
    line-height: 24px;
    color: #fff;
    flex: 1;

    padding-left: 10px;
    margin-bottom: 10px;
  }

  .step {
    & > * {
      color: #fff;
    }
    display: flex;
    gap: 10px;
    align-items: center;
    margin-bottom: 10px;
  }

  .step-first .step-number {
    font-size: 28px;
  }

  .step-number {
    width: 50px;
    padding: 0px 0px;
    line-height: 37px;
    text-align: center;
    font-weight: 700;
    font-size: 35px;
    /* or 156% */

    color: #ffffff;
  }
  .step-desc {
    flex: 1;
    text-align: left;
    font-weight: 400;
    font-size: 16px;
    line-height: 23px;
    /* or 115% */

    color: #ffffff;
  }

  .n3 {
    padding-left: 8px;
  }

  .button-start {
    line-height: 59px;
    background: #ffffff;
    color: #6a25d7;
    margin-bottom: 35px;
    font-weight: 800;
    font-size: 23px;
    max-width: 294px;
    height: 60px;
  }

  .teacher {
    .teacher-title {
      text-align: center;
      line-height: 79px;
      b {
        font-size: 65px;
      }
      font-size: 65px;
      font-weight: normal;
      color: #000000;
      margin-bottom: 150px;
    }

    .teacher-card {
      border: 6px solid #ecb6ff;
      border-radius: 35px;
      max-width: 600px;
      width: 100%;
      margin: 0 auto;

      background: #fff;
      position: relative;

      padding: 200px 0 0px;

      .teacher-name {
        text-align: center;
        margin-bottom: 30px;

        font-weight: 600;
        font-size: 25px;

        color: #000000;
      }

      .teacher-img {
        position: absolute;
        top: -130px;
        left: 50%;
        transform: translateX(-50%);

        background: radial-gradient(
            139.8% 145.82% at -10.2% -6.6%,
            #d661ff 0%,
            #7a00a5 56.57%,
            #cc5cf3 100%
          )
          /* warning: gradient uses a rotation that is not supported by CSS and may not behave as expected */;
        box-shadow: inset 0px 12px 4px rgba(0, 0, 0, 0.25);

        width: 300px;
        height: 300px;
        border-radius: 50%;
        overflow: hidden;

        img {
          position: relative;
          top: 10px;
        }
      }

      ul {
        margin-bottom: 40px;
        padding: 0 70px;
      }

      li {
        position: relative;
        list-style: none;
        padding-left: 18px;
        font-size: 20px;

        color: #000000;
      }

      li:before {
        position: absolute;
        content: "·";
        font-size: 40px;
        line-height: 20px;
        top: 0;
        left: 0;
      }

      .button-start {
        margin-bottom: 60px;
        color: #bf13fc;
        border: 1px solid #bf13fc;
        font-size: 22px;
        height: 60px;
        line-height: 56px;
      }
    }

    margin-bottom: 150px;
  }
  .payment {
    width: 100%;
    max-width: 750px;

    margin: 0 auto;

    .payment-title {
      font-weight: 800;
      font-size: 50px;
      text-align: center;
      color: #000000;
      margin-bottom: 15px;
    }

    .payment-desc {
      font-weight: 400;
      font-size: 30px;
      text-align: center;
      color: #000000;
      margin-bottom: 31px;
    }

    .payment-item {
      border-radius: 24px;
      padding: 30px;
      margin-bottom: 30px;

      max-width: 700px;
      width: 100%;

      margin: 0 auto;
      border: 2px solid #000000;

      display: flex;
      align-items: center;
      img {
        width: 40px;
        margin-right: 40px;
      }

      p {
        font-weight: 600;
        font-size: 25px;
        /* identical to box height */

        color: #000000;
      }
      margin-bottom: 30px;
    }

    .button-start {
      color: #000000;
      border: 2px solid #000000;
      background: transparent;
      margin-bottom: 25px;
      font-weight: 600;
      line-height: 53px;
    }

    .payment-text {
      text-align: center;
      font-weight: 400;
      font-size: 15px;
      color: #000000;
    }
  }
}

.vse-zakupki-eto {
  max-width: 1300px;
  width: 100%;
  margin: 0 auto;
  margin-bottom: 70px;

  text-align: center;

  .eto-title {
    font-weight: 900;
    font-size: 40px;
    line-height: 49px;
    /* identical to box height */

    background: linear-gradient(180deg, #bf13fc 0%, #620384 100%);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
  }

  .eto {
    font-weight: 600;
    font-size: 25px;
    line-height: 30px;

    color: #000000;

    margin-bottom: 100px;
  }

  .eto-info-holder {
    margin-bottom: 100px;
  }
  .eto-info-item {
    img {
      margin-bottom: 10px;
    }
    .eto-word {
      margin-bottom: 20px;
    }
  }

  .eto-info-desk {
  }

  .eto-word {
    font-size: 28px;

    font-weight: 900;
    background: linear-gradient(180deg, #acacac 0%, #000000 100%);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
  }

  .button-start {
    color: #bf13fc;
    font-weight: 700;
    font-size: 20px;

    border: 2px solid #bf13fc;
    filter: drop-shadow(0px 0px 20px #bf13fc);
    border-radius: 100px;
  }
}

.tarifs {
  width: 100%;
  padding: 0 0px;
  padding-top: 50px;
  padding-bottom: 1px;

  .h3-title,
  .h4-title {
    color: #ffffff;
    font-weight: 900;
  }

  .h3-title {
    font-size: 55px;
    margin-bottom: 6rem;
  }

  .h4-title {
    font-size: 25px;
  }

  p {
    color: #ffffff;
    font-size: 15px;
    font-weight: 400;
  }

  .tarif-type-title {
    margin-bottom: 120px;
  }

  .card-holder {
    display: flex;
    align-items: baseline;

    max-width: 1300px;
    margin: 0 auto;

    &.card-holder-1 {
      gap: 50px;
      .card-item {
        padding: 85px 15px 60px;
        ul li {
          text-transform: lowercase;
          b.cap {
            text-transform: uppercase;
          }
        }
        .discount {
          right: -39px;
          font-size: 24px;
          width: 90.29px;
          height: 44.95px;
          line-height: 43px;
        }
      }
    }

    .card-item {
      background: #ffffff;
      box-shadow: 0px 4px 16px rgba(0, 0, 0, 0.45);
      border-radius: 15px;
      width: 365px;
      padding: 0 30px;
      position: relative;
      padding-top: 120px;
      padding-bottom: 60px;

      ul {
        margin-bottom: 40px;
      }

      .img-holder-1,
      .img-holder-2 {
        img {
          width: 100px;
        }
        padding: 10px;
        background: #ffffff;
        position: absolute;
        top: -60px;
        left: 50%;
        transform: translateX(-50%);
      }

      .img-holder-1 {
        border-radius: 50%;
      }

      .img-holder-2 {
        display: flex;
        border-radius: 20px;
        padding: 10px 20px;

        img + img {
          margin-left: 30px;
        }
      }

      .discount {
        position: absolute;
        top: 64%;
        right: -56px;

        text-align: center;
        font-weight: 700;
        font-size: 20px;
        line-height: 51px;
        color: #ff0000;

        width: 122.29px;
        height: 54.95px;

        background: #ebff00;
        border: 1px solid #ffe600;
        box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
        border-radius: 5px;
        transform: rotate(10deg);
      }

      li,
      b,
      span {
        font-size: 15px;
      }

      li {
        position: relative;
        list-style: none;
        padding-left: 18px;

        color: #000000;
      }

      li:before {
        position: absolute;
        content: "·";
        font-size: 33px;
        line-height: 20px;
        top: -3px;
        left: 0;
      }

      li.text-red-line-through {
        text-decoration: line-through;
        color: #ff0000;
      }

      li.text-purple {
        color: #d661ff;
        b {
          color: #8000ad;
        }
      }

      .price-red {
        color: #ff0000;
      }

      .price-big {
        font-weight: 600;
        font-size: 37px;
        line-height: 61px;

        color: #7a00a5;
      }

      .price-desc {
        color: #000000;
      }

      .strikethrough {
        position: relative;
      }
      .strikethrough:before {
        position: absolute;
        content: "";
        left: 0;
        top: 50%;
        right: 0;
        border-top: 1px solid;
        border-color: inherit;

        -webkit-transform: rotate(-5deg);
        -moz-transform: rotate(-5deg);
        -ms-transform: rotate(-5deg);
        -o-transform: rotate(-5deg);
        transform: rotate(-5deg);
      }

      .button-start {
        font-size: 20px;
        line-height: 55px;
        height: 55px;
        color: #ffffff;
        background: linear-gradient(180deg, #c65aec 0%, #8100ae 100%);
      }
    }
  }

