.form-registration {
  margin-top: 150px;
  max-width: 1200px;
  width: 100%;
  .form-title {
    font-weight: 900;
    font-size: 50px;
    text-align: center;
    margin-bottom: 5px;
  }

  .p-title {
    font-size: 25px;
  }

  input {
    border-style: none;
    background: transparent;
    outline: none;
  }

  .form-container {
    .form-group {
      max-width: 600px;
      width: 100%;
      margin: auto;
      position: relative;
    }

    .bt-line {
      position: absolute;
      width: 90%;
      border-top: 2px solid #000000;
      top: 55%;
      left: 50%;
      transform: translateX(-50%);
    }

    .input-t {
      border: 2px solid #000000;
      border-radius: 30px;
      height: 100px;
      padding: 30px;
      margin-bottom: 30px;
      position: relative;
    }

    .container {
      display: block;
      position: relative;
      padding-left: 18px;
      cursor: pointer;
      font-size: 22px;
      -webkit-user-select: none;
      -moz-user-select: none;
      -ms-user-select: none;
      user-select: none;

      font-weight: 400;
      font-size: 18px;
      line-height: 30px;
    }

    /* Hide the browser's default checkbox */
    .container input {
      position: absolute;
      opacity: 0;
      cursor: pointer;
      height: 0;
      width: 0;
    }

    /* Create a custom checkbox */
    .checkmark {
      position: absolute;
      top: 2px;
      left: 11px;
      height: 25px;
      width: 25px;
      border-radius: 50%;
      background-color: #eee;
    }

    /* On mouse-over, add a grey background color */
    .container:hover input ~ .checkmark {
      background-color: #ccc;
    }

    /* When the checkbox is checked, add a blue background */
    .container input:checked ~ .checkmark {
      background-color: #2196f3;
    }

    /* Create the checkmark/indicator (hidden when not checked) */
    .checkmark:after {
      content: "";
      position: absolute;
      display: none;
    }

    /* Show the checkmark when checked */
    .container input:checked ~ .checkmark:after {
      display: block;
    }

    /* Style the checkmark/indicator */
    .container .checkmark:after {
      left: 10px;
      top: 7px;
      width: 5px;
      height: 10px;
      border: solid white;
      border-width: 0 3px 3px 0;
      -webkit-transform: rotate(45deg);
      -ms-transform: rotate(45deg);
      transform: rotate(45deg);
    }
  }

  .form-button {
    display: inline-block;
    max-width: 430px;
    width: 100%;
    height: 90px;
    background: linear-gradient(94.67deg, #d661ff 6.97%, #6a008f 101.94%);
    border-radius: 100px;
    border: none;
    font-weight: 700;
    font-size: 25px;
    color: #ffffff;
    line-height: 85px;

    &:hover {
      transform: scale(1.05, 1.05);
      transition: all 0.3s ease-in-out;
    }
  }
}

